def find_common_elements(arr1, arr2): 
    """This function takes two arrays as input and returns a set of common elements between the two arrays. 

    Parameters: 
    arr1 {list} -- The first array 
    arr2 {list} -- The second array 

    Returns: 
    set -- The set of common elements 
    """
    common_elements = set() 
    for i in range(len(arr1)): 
        for j in range(len(arr2[0])): 
            for k in range(len(arr2)): 
                if arr1[i] == arr2[j][k]: 
                    common_elements.add(arr1[i]) 
    return common_elements
